import React, { useContext } from "react";
import HeaderLogo from "../images/HeaderLogo.svg"
// import '../css/Header.css' // CSS import 제거
import searchIcon from "../images/search-icon.svg"
import userIcon from "../images/user-icon.svg"
import { useNavigate } from "react-router-dom";
import { AuthContext } from "../contexts/AuthContext.js";

const Header = () => {
    const { accessToken, logout } = useContext(AuthContext);
    console.log("accessToken", accessToken)
    const navigate = useNavigate(); 

    const goToMain = () => {
        navigate('/');
    }

    const goToLogin =() => {
        navigate('/login');
    }

    const goToMyPage = () => {
        navigate("/mypage");
    };

    const handleLogout = () => {
        logout();
        navigate("/");
    };

    return (
        <div className="flex w-full flex-col flex-shrink-0 pt-12 pb-6 items-center fixed top-0 left-0 bg-white z-50">
            <div className="flex w-[970px] justify-center items-end gap-24">
                <div className="flex w-28 flex-col items-start cursor-pointer" onClick={goToMain}>
                    <div className="text-[#2E2E2E] text-right font-['Noto_Sans_KR'] text-xs font-bold leading-[140%]">
                        송도동네
                    </div>
                    <div className="pt-1 pb-0.5">
                        <img src={HeaderLogo} alt="header-logo" />
                    </div>
                    <div className="text-black text-left font-['Noto_Sans_KR'] text-[8.5px] font-semibold leading-[140%]">
                        감도 높은 송도동 F&B 큐레이션
                    </div>
                </div>
                
                <div className="flex justify-end items-center">
                    <div className="flex w-[525px] h-9 items-start rounded-[10px] border-[1.2px] border-[#C6C6C6] bg-white">
                        <div className="flex flex-wrap items-start flex-1 h-full">
                            <input
                                type="search"
                                placeholder="찾고 있는 축제나 맛집을 검색해보세요"
                                className="w-full h-full border-none outline-none px-3 text-[#1C1814] font-['Noto_Sans_KR'] text-xs font-normal leading-[140%]"
                            />
                        </div>
                        <div className="flex items-center justify-center px-3 cursor-pointer">
                            <img id="search" src={searchIcon} alt="search" />
                        </div>
                    </div>
                    
                    <div className="ml-4">
                        {accessToken ? (
                            <>
                                <div 
                                    className="flex items-center gap-2 px-4 py-2 rounded-lg bg-gray-100 hover:bg-gray-200 cursor-pointer transition-colors"
                                    onClick={goToMyPage}
                                >
                                    <img src={userIcon} width="20" height="20" alt="user-icon" />
                                    <span className="text-sm font-medium">마이페이지</span>
                                </div>
                                <div 
                                    className="mt-2 px-4 py-2 text-center rounded-lg bg-red-100 hover:bg-red-200 cursor-pointer transition-colors text-sm font-medium"
                                    onClick={handleLogout}
                                >
                                    로그아웃
                                </div>
                            </>
                        ) : (
                            <div 
                                className="flex items-center gap-2 px-4 py-2 rounded-lg bg-blue-100 hover:bg-blue-200 cursor-pointer transition-colors"
                                onClick={goToLogin}
                            >
                                <img src={userIcon} width="20" height="20" alt="user-icon" />
                                <span className="text-sm font-medium">로그인/회원가입</span>
                            </div>
                        )}
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Header
